import React from 'react';
import {NavLink} from 'react-router-dom';

export default class Nav extends React.Component {
	render() {
		return (
			<>
				<section>
					<nav className="nav">
						<NavLink>
							<p>Projects</p>
						</NavLink>
						<NavLink>
							<p>Contact</p>
						</NavLink>
					</nav>
				</section>

			</>
		)
	}
}
